import React, { useState, useEffect } from 'react'
import axios from "axios"
import { Route, Link } from "react-router-dom"




export default function Search() {



  const [searchImages, updateimages] = useState([])
  const [searchText, setSearchText] = useState([])
  useEffect(() => {
    const apiCall = async () => {
      const searchUrl =  "https://api.unsplash.com/search/photos?page=1&query=${pizza}&client_id=1kV8nZ5_pV1wBQJB_prZ0Rs5pkpTarBY2-NNW7X-_yg"
      const searchImages = await axios(searchUrl)
      console.log(searchImages)
      console.log(searchImages.data)


      updateimages(searchImages.data)
    }
    apiCall()
  }, [])

  let handleChange = (e) => {
    setSearchText(
      e.target.value
    )
  }

  return (
    <>

      <nav>
        <input type="text" placeholder="Find image" onChange={handleChange}/>
     <Link to="/search"><button onClick={() => searchUrl.map() }>search</button></Link>
      </nav>
      <Route path="/search">
        <h1>Search Results</h1>
        </Route>

    </>
  )
}


